selector_to_html = {"a[href=\"#governing-law-and-venue\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Governing law and venue<a class=\"headerlink\" href=\"#governing-law-and-venue\" title=\"Link to this heading\">#</a></h2><p>The agreement and any dispute arising out of the agreement are governed by Danish law and such disputes must be heard by Copenhagen District Court or the jurisdiction of the defendant\u2019s domicile unless otherwise provided by absolute consumer rights in Denmark. This applies without consideration for rules in international private law which may lead to the application of other law than Danish law.</p>", "a[href=\"#terms-and-conditions-for-all-services-and-functions\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Terms and conditions for all services and functions<a class=\"headerlink\" href=\"#terms-and-conditions-for-all-services-and-functions\" title=\"Link to this heading\">#</a></h2><h3>Parties to the agreement<a class=\"headerlink\" href=\"#parties-to-the-agreement\" title=\"Link to this heading\">#</a></h3><p>When you register with Concordium Legacy Wallet, you enter into an agreement with:</p><p>Concordium Software ApS, Amaliegade 4, 1256 K\u00f8benhavn K, Denmark. CVR no.: 42334758. Our email address is <a class=\"reference external\" href=\"mailto:contact%40concordium.software\">contact<span>@</span>concordium<span>.</span>software</a>.</p>", "a[href=\"#baking-and-delegation\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Baking and Delegation<a class=\"headerlink\" href=\"#baking-and-delegation\" title=\"Link to this heading\">#</a></h2><p>Node runners are awarded CCD for running nodes on the Concordium blockchain through a process called baking. Other CCD holders can be rewarded for supporting this process through delegation. The Concordium Legacy Wallet supports management of baking and delegation. Each account can only have one baking or delegation process active at any given time.</p><p>While engaged in baking or delegation, the allocated CCD will remain in the account in a locked form. Termination of baking and delegation activates a cool-down period, where baking and delegation is still active, however, the CCDs will not be available in the wallet until the cool-down period is over. Read more about baking and delegation on <a class=\"reference external\" href=\"https://developer.concordium.software\">developer.concordium.software</a>.</p>", "a[href=\"#activation-code-and-personal-password\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Activation code and personal password<a class=\"headerlink\" href=\"#activation-code-and-personal-password\" title=\"Link to this heading\">#</a></h2><p>When you register in Concordium Legacy Wallet, you will need to create a personal passcode. If your mobile device supports it, you can subsequently activate your fingerprint or use facial recognition instead of the 6-digit password. You should be aware that all fingerprints/facial recognitions linked to your mobile device can be used to log on to Concordium Legacy Wallet and use the functions. You are therefore obliged to ensure that you have only activated your own fingerprints and your own facial recognition if you want to use them instead of the 6-digit password for access to Concordium Legacy Wallet. Concordium Legacy Wallet does not store your fingerprints or facial recognition.</p>", "a[href=\"#privacy\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Privacy<a class=\"headerlink\" href=\"#privacy\" title=\"Link to this heading\">#</a></h2><p>Concordium Software respects your privacy to the effect that Concordium Software will not monitor, edit, or disclose any personal information about you or your account, including its contents or your use of the Concordium Legacy Wallet, without your prior consent unless Concordium Software in good faith beliefs that such action is necessary to: (i) comply with legal process or other legal requirements of any governmental authority; (ii) protect and defend the rights or property of Concordium Software; (iii) enforce this Agreement; (iv) protect the interests of users of the Concordium Legacy Wallet other than you or any other person; (v) operate or conduct maintenance and repair of Concordium\u2019s services or equipment, including the Concordium Legacy Wallet as authorized by law; or (vi) if your identity is revoked in accordance with the identity revocation process as required to comply with (i). You are assumed to have no expectation of privacy with respect to the Internet generally. Your IP address is transmitted and recorded with each message or other information you send from the Concordium Legacy Wallet. When you create an identity with a third party supplier, you have entered an agreement directly with such a third party supplier and such a third party supplier will store data about you and in this case, the third party supplier\u2019s privacy policy and terms and conditions apply.</p>", "a[href=\"#introduction\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Introduction<a class=\"headerlink\" href=\"#introduction\" title=\"Link to this heading\">#</a></h2><p>Concordium Legacy Wallet is a digital wallet that is offered by Concordium Software ApS (\u2018Concordium Software\u2019). At <a class=\"reference external\" href=\"https://developer.concordium.software\">developer.concordium.software</a>, you can read about how the app works. Concordium Software may continually change and/or adjust the functions of Concordium Legacy Wallet. Concordium Software\u2019s terms and conditions apply to Concordium Legacy Wallet users.</p><p>The wallet itself will register and use data about you. Concordium Software will not register or use data about you.</p>", "a[href=\"#intellectual-property-rights-and-license\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Intellectual property rights and license<a class=\"headerlink\" href=\"#intellectual-property-rights-and-license\" title=\"Link to this heading\">#</a></h2><p>Concordium Software retains all right, title, and interest in and to all of Concordium Software\u2019s brands, logos, and trademarks, including, but not limited to, Concordium Mobile Wallet, Concordium Legacy Wallet, Concordium Wallet for Mobile, Concordium Desktop Wallet, Concordium Wallet for Web, Concordium Client, and variations of the wording of the said brands, logos, and trademarks.</p>", "a[href=\"#complaints\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Complaints<a class=\"headerlink\" href=\"#complaints\" title=\"Link to this heading\">#</a></h2><p>You can always write to Concordium Software if you disagree with us. In this way, we make sure that such disagreement is not based on a misunderstanding. The address is Amaliegade 4, 1256 K\u00f8benhavn K, Denmark.</p>", "a[href=\"#term\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Term<a class=\"headerlink\" href=\"#term\" title=\"Link to this heading\">#</a></h2><p>This agreement will apply between you and Concordium Software from your download of the Concordium Legacy Wallet, and until you have completely removed the Concordium Legacy Wallet in its entirety from your device.</p><p>The section <em>Concordium Software\u2019s liability for damages</em> shall apply indefinitely.</p>", "a[href=\"#what-you-need-in-order-to-register-with-mw-gen1\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">What you need in order to register with Concordium Legacy Wallet<a class=\"headerlink\" href=\"#what-you-need-in-order-to-register-with-mw-gen1\" title=\"Link to this heading\">#</a></h2><p>The following is required to register with Concordium Legacy Wallet:</p>", "a[href=\"#concordium-softwares-liability-for-damages\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Concordium Software\u2019s liability for damages<a class=\"headerlink\" href=\"#concordium-softwares-liability-for-damages\" title=\"Link to this heading\">#</a></h2><p>Concordium Software is not liable for damages for late or defective performance of the Concordium Legacy Wallet and/or our contractual obligations resulting from error or negligence.</p><p>Even in areas in which stricter liability applies, Concordium Software is not liable for losses arising from</p>", "a[href=\"#parties-to-the-agreement\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Parties to the agreement<a class=\"headerlink\" href=\"#parties-to-the-agreement\" title=\"Link to this heading\">#</a></h3><p>When you register with Concordium Legacy Wallet, you enter into an agreement with:</p><p>Concordium Software ApS, Amaliegade 4, 1256 K\u00f8benhavn K, Denmark. CVR no.: 42334758. Our email address is <a class=\"reference external\" href=\"mailto:contact%40concordium.software\">contact<span>@</span>concordium<span>.</span>software</a>.</p>", "a[href=\"#registering-as-a-mw-gen1-user\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Registering as a Concordium Legacy Wallet user<a class=\"headerlink\" href=\"#registering-as-a-mw-gen1-user\" title=\"Link to this heading\">#</a></h2><p>Before you can use Concordium Legacy Wallet, you will need to create a digital identity certificate and create an initial account with an identity provider by following the instructions in the app. An identity provider is a third-party supplier and independent of Concordium Software. The Concordium Legacy Wallet stores data in encrypted form from the identity provider, which Concordium Software does not have access to.</p><p>After you have created your digital identity certificate and your initial account, you can create additional accounts (\u2018regular accounts\u2019) with which you will be able to carry out transactions. Concordium Software may impose a limit to how many accounts you can create in a single Concordium Legacy Wallet.\nPlease note that you can only register one account as the initial account.</p>", "a[href=\"#terms-and-conditions-for-mw-gen1-previously-concordium-mobile-wallet\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Terms and Conditions for Concordium Legacy Wallet (previously Concordium Mobile Wallet)<a class=\"headerlink\" href=\"#terms-and-conditions-for-mw-gen1-previously-concordium-mobile-wallet\" title=\"Link to this heading\">#</a></h1><p>Effective from September 2, 2022</p>", "a[href=\"#acceptance\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Acceptance<a class=\"headerlink\" href=\"#acceptance\" title=\"Link to this heading\">#</a></h2><p>The first time you open the Concordium Legacy Wallet, you\u2019ll be asked to click \u201cYes, I Accept\u201d to confirm that you agree to these terms and conditions.</p>", "a[href=\"#fees-and-charges\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Fees and charges<a class=\"headerlink\" href=\"#fees-and-charges\" title=\"Link to this heading\">#</a></h2><p>Concordium Software currently does not charge any fee for registration with Concordium Legacy Wallet. Concordium Legacy Wallet does not charge a transaction fee; however, you have to pay a transaction fee for transactions on the blockchain.</p><p>Any other costs and charges related to your use of the Concordium Legacy Wallet shall be paid by you, including but not limited to costs to the identity provider, if any.</p>", "a[href=\"#our-notification-of-unauthorized-use-and-security-threats\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Our notification of unauthorized use and security threats<a class=\"headerlink\" href=\"#our-notification-of-unauthorized-use-and-security-threats\" title=\"Link to this heading\">#</a></h3><p>We may issue information about general security threats through <a class=\"reference external\" href=\"https://developer.concordium.software\">developer.concordium.software</a> and social media.</p>", "a[href=\"#data-retention-and-deletion\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Data retention and deletion<a class=\"headerlink\" href=\"#data-retention-and-deletion\" title=\"Link to this heading\">#</a></h2><p>Concordium as a company does not retain and therefore cannot delete any user identifiable information. However, to get an account you must obtain an identity object issued by an identity provider. The identity object contains some user identifiable information such as your name. By default the identity object is only stored encrypted in the wallet and is not visible on-chain. Some data derived from the identity object is sent to the chain, but by default it is not possible to obtain user identifiable information from the information stored in the account on the chain. However, if you choose to reveal any attributes associated with your account, these attributes will be visible on-chain, and can never be deleted.</p>", "a[href=\"#changes\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Changes<a class=\"headerlink\" href=\"#changes\" title=\"Link to this heading\">#</a></h2><p>You will be notified on <a class=\"reference external\" href=\"https://developer.concordium.software\">developer.concordium.software</a> if we change the terms and conditions. We may change the terms and conditions without notice. You can read the terms and conditions at <a class=\"reference external\" href=\"https://developer.concordium.software\">developer.concordium.software</a>, from which you can also print, download, or email them.</p><p>If you do not wish to be covered by the new terms and conditions, you must notify us before the new terms and conditions enter into force. If you notify us that you do not wish to be covered by the new terms and conditions, we will consider the Concordium Legacy Wallet agreement to be terminated from the date on which the new terms and conditions enter into force. If we do not hear from you, we will regard it as your acceptance of the changes.</p>", "a[href=\"#other-obligations-etc\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Other obligations etc.<a class=\"headerlink\" href=\"#other-obligations-etc\" title=\"Link to this heading\">#</a></h2><p>You have a duty to ensure that the details you provide are correct and updated at any given time. Your Concordium Legacy Wallet is personal and may be used only by you. You must not disclose your passwords to others, write them down, or save them on your mobile device.</p><p>Concordium Legacy Wallet must not be used for illegal activities or purposes.</p>", "a[href=\"#new-copy-of-these-terms-and-conditions\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">New copy of these terms and conditions<a class=\"headerlink\" href=\"#new-copy-of-these-terms-and-conditions\" title=\"Link to this heading\">#</a></h2><p>You can always find the latest version on <a class=\"reference external\" href=\"https://developer.concordium.software\">developer.concordium.software</a>.</p><p>You can contact Concordium Legacy Wallet support via <a class=\"reference external\" href=\"mailto:support%40concordium.software\">support<span>@</span>concordium<span>.</span>software</a>.</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
